import React from 'react';
import Navbar from '../components/Navbar';
import { useNavigate } from 'react-router-dom';

const LandingPage = () => {
  const navigate = useNavigate();

  const handleStart = () => {
    navigate('/signup');
  };
  return (
    <div>
      <Navbar />
      <div className="home-container">
        <h1>Welcome to Stocks App</h1>
        <p className="home-description">
          A powerful platform to track and manage your favorite stocks.
        </p>
        <button className="cta-button" onClick={handleStart}>Get Started</button>
        <div className="features-container">
          <div className="feature-section">
            <h2>Real-Time Stock Data</h2>
            <p>
              Access up-to-date stock information with real-time data feeds
              from major stock exchanges.
            </p>
          </div>
          <div className="feature-section">
            <h2>Stock Tracking</h2>
            <p>
              Track the performance of your favorite stocks and receive alerts
              for price changes.
            </p>
          </div>
          <div className="feature-section">
            <h2>Personalized Watchlists</h2>
            <p>
              Create custom watchlists to monitor specific stocks or sectors of
              interest.
            </p>
          </div>
          <div className="feature-section">
            <h2>Portfolio Management</h2>
            <p>Manage your investment portfolio and track your overall performance.</p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default LandingPage;
